import React from 'react';

const SearchJobs: React.FC = () => {
  return (
    <div className="bg-gradient-to-br from-purple-50 via-purple-100 to-purple-50 rounded-2xl shadow-lg p-6 h-[180px] flex flex-col justify-center">
      <div className="text-center">
        <h1 className="text-xl font-bold text-[#6B46C1] mb-6">Search Jobs</h1>
        <div className="relative max-w-lg mx-auto">
          <input
            type="text"
            placeholder="Search jobs by title, company or skill"
            className="w-full h-[50px] px-6 rounded-full border border-gray-200 focus:outline-none focus:ring-2 focus:ring-purple-500/20 focus:border-purple-500 shadow-sm"
          />
        </div>
      </div>
    </div>
  );
};

export default SearchJobs;
